    <div className="App">
      <div className="head">
        <h1>Make Your Plan</h1>
      </div>

      <div className="body">
        <div className="box">
          <input type="text" />
        </div>
        <br />
        <button className="btn btn-primary">Add</button>
      </div>
    </div>
  );
}

export default App;
